window.bookSummaryJSON = "<p>\"Netflix and chill\" takes on a whole new meaning when Posie starts dating the Reaper.</p> <p>Poor Brody. As reaper leader for the Canadian guild, he and his crew don’t get as much work as other countries until the Dark Lord gives them a new mandate: Establish a dating service on Earth that will facilitate the meeting between citizens of hell and humans, with the end goal being babies.&nbsp;</p> <p>In other words, become a pimp.&nbsp;</p> <p>It’s a cruel demotion for a reaper who just wanted to guide souls to their final destination. He is dying to return to hell, until he meets the stubborn woman living across the hall.&nbsp;</p> <p>The devil wants Posie mated, but she is resisting all attempts. What will it take to make her see the light?&nbsp;</p> <p>And how will she react when she finally discovers that death has been knocking at her door?</p>"; 
